import { ArrowRightIcon } from "@heroicons/react/solid";
import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <header className="bg-gray-900 md:sticky top-0 z-10 shadow-lg">
      <div className="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center justify-between">

        {/* Logo / Brand Name */}
        <Link
          to="/"
          className="text-purple-100 text-2xl font-semibold tracking-wide hover:text-purple-300 transition duration-300"
        >
          Annie Rome
        </Link>

        {/* Navigation Links */}
        <nav className="md:ml-auto flex items-center space-x-6 text-purple-200 text-lg">
          <Link to="/projects" className="hover:text-purple-400 transition duration-300">
            Projects
          </Link>
          <Link to="/resume" className="hover:text-purple-400 transition duration-300">
            Resume
          </Link>
        </nav>

        {/* Contact Button */}
        <a
          href="#contact"
          className="inline-flex items-center bg-purple-600 text-white font-medium py-2 px-4 rounded-lg hover:bg-purple-700 transition duration-300 shadow-md"
        >
          Contact Me
          <ArrowRightIcon className="w-5 h-5 ml-2" />
        </a>

      </div>
    </header>
  );
}
